import styled from "styled-components";
import { Project } from "../../types/project";

const All = ({ projectData }: { projectData: Project[] }) => {
  return (
    <Wrap>
      {projectData.map((project) => (
        <Content key={project.id}>
          <div>
            <h2>{project.title}</h2>
            <span>{project.date}</span>
            <span>기간: {project.term}</span>
            <span>Content: {project.content}</span>
            <span>Review: {project.review}</span>
            <span>Role: {project.role.join(", ")}</span>
            <span>Skill: {project.skill.join(", ")}</span>
          </div>
          <div>
            <p>Link: {project.link}</p>
            <p>Git: {project.git}</p>
          </div>
        </Content>
      ))}
    </Wrap>
  );
};

export default All;

const Wrap = styled.div`
  display: flex;
  width: 100%;
  height: 100%;
  justify-content: center;
  align-items: center;
`;
const Content = styled.div``;
